import {useState} from "react";
import {Button} from "react-bootstrap";

function Benefit({benefit}) {
    const [cur, setCur] = useState('무관');

    return (
        <div>
            <Button className={(cur === '무관' ? "activeButton" : "inactiveButton")}>무관</Button>
            {benefit.map(b =>
                <Button className={(cur === b ? "activeButton" : "inactiveButton")}>{b}</Button>
            )}
        </div>
    )
}

export default Benefit;
